exports.Check = (sql) => {
  return new Promise((resolve, reject) => {
    Select(sql, (error, result) => {
      if (error) reject(error);

      console.log(result);

      resolve(result);
    });
  });
};

exports.formatCurrency = (value) => {
  var formattedValue = parseFloat(value).toFixed(2);
  return "₱" + formattedValue.replace(/\d(?=(\d{3})+\.)/g, "$&,");
};

