exports.PDFTableHeaderFormatter = (data = []) => {
  let header = [];
  data.forEach((item) => {
    header.push({
      text: item,
      style: "tableheader",
      border: [false, true, false, true],
    });
  });

  return header;
};

exports.PDFContentFormatter = (data = []) => {
  let details = [];
  data.forEach((item) => {
    // const { product, price, quantity, total } = item;
    let content = [];

    for (const i in item) {
      content.push({
        text: item[i] === typeof Float32Array ? item[i].toFixed(2) : item[i],
        style: "tablecontent",
        border: [false, false, false, false],
      });
    }

    details.push(content);
  });

  return details;
};

exports.ReceiptItemsFormatter = (items) => {
  let details = [];
  for (const i of items) {
    const { id, name, price, quantity } = i;

    details.push({
      columns: [
        {
          width: "*",
          text: name,
          fontSize: 8,
        },
        {
          width: "*",
          text: quantity,
          fontSize: 8,
          alignment: "center",
        },
        {
          width: "*",
          text: (parseFloat(price) * parseFloat(quantity)).toFixed(2),
          fontSize: 8,
          alignment: "right",
        },
      ],
      columnGap: 20,
    });
  }

  return details;
};
